import Statistics from "./Statistics";

const StatisticList = ({
	stats,
	title }) => {
	return (
		stats.map(el => (
			<Statistics
				key={el.id}
				label={el.label}
				percentage={el.percentage}
				title={title}
			/>
		))
	)

}
export default StatisticList
